var initialState = [
    {
        id : 1,
        code : 'A01',
        name : 'IPX',
        price : 800,
        status : true
    },
    {
        id : 2,
        code : 'B01',
        name : 'SS8',
        price : 880,
        status : false
    }
];

const products = (state=initialState, action) => {
    switch(action.type){
        default : return state;
    }
}

export default products;
